- input: "TEXT\x1CC00421388\x1C.TEXT\x1C\x1CF3XA\x1CContributions to the Committee
    from conduit, ActBlue, totalled $5,299.00 during this reporting period.  No receipts
    from any source over $200.00 were received, therefore were not reported under
    Section 11(a)(i).  All receipts totalling $5,299.00 were reported as unitemized
    items under Section 11(a)(ii).                                                                                                                                                                                           10/20/2010
    - Response to Marlene D. Colucci, Senior Campaign Finance Analyst, Reports Analysis
    Division, Federal Election Commission                                                                                                                                                                                  As
    requested in the letter dated October 8, 2010, it appears that contributions from
    our conduit, ActBlue, were not adequately identified.  The report clearly states
    the receipt of each and every receipt from our conduit, ActBlue, which totalled
    $5,299.00 during this reporting period. As stated above, no donation through the
    conduit totalled over $200.00, therefore all were reported in the unitemized category,
    Section 11 (a)(ii) as required . None of the memo items were listed on Schedule
    A supporting Line 11 (a)(i) but were supporting Schedule A Line 11 (a)(ii). Should
    further questions arise please contact me.                                                                                                                                                                                     \n"
